Mykolaiv Raion (Ukrainian: Миколаївський район) was a raion (district) in Lviv Oblast in western Ukraine. Its administrative center was Mykolaiv. The raion was abolished on 18 July 2020 as part of the administrative reform of Ukraine, which reduced the number of raions of Lviv Oblast to seven. The area of Mykolaiv Raion was merged into Stryi Raion. The last estimate of the raion population was 62,537 (2020 est.).It was established in 1939.
At the time of disestablishment, the raion consisted of three hromadas:
Mykolaiv urban hromada with the administration in Mykolaiv;
Rozvadiv rural hromada with the administration in the selo of Rozvadiv;
Trostianets rural hromada with the administration in the selo of Trostianets.

Vovchansk Raion (Ukrainian: Вовчанський район) was a raion (district) in Kharkiv Oblast of Ukraine. Its administrative center was the town of Vovchansk. The raion was abolished on 18 July 2020 as part of the administrative reform of Ukraine, which reduced the number of raions of Kharkiv Oblast to seven. The area of Vovchansk Raion was, together with Pechenihy and Zmiiv Raions, merged into Chuhuiv Raion. The last estimate of the raion population was 44,448 (2020 est.)At the time of disestablishment, the raion consisted of two hromada:
Staryi Saltiv settlement hromada with the administration in the urban-type settlement of Staryi Saltiv;
Vovchansk urban hromada with the administration in Vovchansk.

At the time of disestablishment, the raion consisted of two hromadas:
Sniatyn urban hromada with the administration in Sniatyn;
Zabolotiv settlement hromada with the administration in the urban-type settlement of Zabolotiv.

It was administered by 10 uyezds (the administrative centers, which all had the town status, are given in parentheses),

Velsky Uyezd (Velsk);
Vologodsky Uyezd (Vologda);
Gryazovetsky Uyezd (Gryazovets);
Kadnikovsky Uyezd (Kadnikov);
Nikolsky Uyezd (Nikolsk);
Solvychegodsky Uyezd (Solvychegodsk);
Totemsky Uyezd (Totma);
Ust-Sysolsky Uyezd (Ust-Sysolsk);
Velikoustyuzhsky Uyezd (Veliky Ustyug);
Yarensky Uyezd (Yarensk).Three towns had a special status: Krasnoborsk, Lalsk, and Verkhovazhskiy Posad.
The Vologda Governorate covered a total area of 402,112 square kilometres (155,256 sq mi), and had a population of 1,341,785 according to the 1897 Russian Empire census. The governorate bordered Arkhangelsk Governorate in the north, Tobolsk Governorate in the northeast, Perm and Vyatka Governorates in the southeast, Kostroma and Yaroslavl Governorates in the south, Novgorod Governorate in the west, and Olonets Governorate in the northwest. The two eastern uyezds, Ust-Sysolsky Uyezd (92%) and Yarensky Uyezd, were predominantly populated by the Komi peoples (Zyrian), while in the whole governorate the Komi accounted for less than 10%.

Dolyna Raion (Ukrainian: Доли́нський райо́н, romanized: Dolynśkyi rajon) was a raion (administrative district) of Ivano-Frankivsk Oblast of Ukraine. The city of Dolyna was the administrative center of the raion. The raion was abolished on 18 July 2020 as part of the administrative reform of Ukraine, which reduced the number of raions of Ivano-Frankivsk Oblast Oblast to six. The area of Dolyna Raion was merged into Kalush Raion. The last estimate of the raion population was 68,266 (2020 est.).
The raion was located in the historical land of Boyko people.
At the time of disestablishment, the raion consisted of three hromadas:
Dolyna urban hromada with the administration in Dolyna;
Vyhoda settlement hromada with the administration in the urban-type settlement of Vyhoda;
Vytvytsia rural hromada with the administration in the selo of Vytvytsia.

The duchy was named after the town of Geldern (Gelder) in present-day Germany. Though the present province of Gelderland (English also Guelders) in the Netherlands occupies most of the area, the former duchy also comprised parts of the present Dutch province of Limburg as well as those territories in the present-day German state of North Rhine-Westphalia that were acquired by Prussia in 1713.
Four parts of the duchy had their own centres, as they were separated by rivers:

the quarter of Roermond, also called Upper Quarter or Upper Guelders – upstream on both sides of the Maas, comprising the town of Geldern as well as Erkelenz, Goch, Nieuwstadt, Venlo and Straelen;spatially separated from the Lower Quarters (Gelderland):

the quarter of the county Zutphen, also called the Achterhoek – east of the IJssel and north of the Rhine, including Doesburg, Doetinchem, Groenlo and Lochem;
the Veluwe Quarter with Arnhem as its capital – west of the IJssel and north of the Rhine, with Elburg, Harderwijk, Hattem and Wageningen;
Nijmegen Quarter, including Betuwe – south of the Rhine and north of the Maas (in between the rivers), including Gendt, Maasbommel, Tiel and Zaltbommel

At the time of disestablishment, the raion consisted of three hromadas:
Buchach urban hromada with the administration in Buchach;
Trybukhivtsi rural hromada with the administration in the selo of Trybukhivtsi;
Zolotyi Potik settlementl hromada with the administration in the urban-type settlement of Zolotyi Potik.

At the time of disestablishment, the raion consisted of three hromadas,
Borodianka settlement hromada with the administration in the urban-type settlement of Borodianka;
Nemishaieve settlement hromada with the administration in the urban-type settlement of Nemishaieve;
Piskivka settlement hromada with the administration in the urban-type settlement of Piskivka.


